INSERT INTO `announcements` (`id`, `title`, `content`, `created_at`) VALUES
(14, 'Invite your Friends! ‚ú®üéâ', 'REGISTER NOW to HELIUM SQUARED ‚Äì Version 2.0 of the Squared System! üí°\r\nHello, DCCians! üåü\r\nWe‚Äôre excited to launch Helium Squared, the upgraded and more powerful version of our Squared System ‚Äì designed for students, by students. Whether you\'re looking for academic support, leadership tools, creative services, or just want to be part of something meaningful on campus, this is for YOU!\r\n‚úÖ Faster Services\r\n‚úÖ Smarter Solutions\r\n‚úÖ Better Experience\r\n‚úÖ More Student-Friendly Tools\r\nüîó Register now and be part of the movement that powers campus productivity. Let‚Äôs grow, serve, and achieve more ‚Äî together. üí™‚ú®\r\nüì£ Share this website to your classmates. Share the word. Helium Squared is here!', '2025-06-01 21:02:00'),
(15, 'Squared Recruitment Registration 2025', 'ùó¢ùóΩùó≤ùóª ùó•ùó≤ùó∞ùóøùòÇùó∂ùòÅùó∫ùó≤ùóªùòÅ ùó∂ùòÄ ùó¢ùó° ‚Äì ùóùùóºùó∂ùóª ùòÅùóµùó≤ ùó¶ùóæùòÇùóÆùóøùó≤ùó± ùóßùó≤ùóÆùó∫ ùóßùóºùó±ùóÆùòÜ! üíöüìë\r\nAre you ready to step up, stand out, and make a difference? This is your chance to be part of Davao Central College‚Äôs very own Squared Team ‚Äì a dynamic group of passionate student volunteers making a difference in the campus community. üí°‚ú®\r\nBeing a student volunteer isn‚Äôt just about helping out ‚Äì it‚Äôs about:\r\n‚úÖ Building leadership and teamwork skills\r\n‚úÖ Making new friends from different programs\r\n‚úÖ Gaining real-world experience in event handling, project management, and more\r\n‚úÖ Creating lasting impact through service-driven initiatives\r\n‚úÖ Having FUN while doing meaningful work!\r\nüì£ We are only accepting ONE (1) volunteer per Program ‚Äì so don‚Äôt miss your chance to represent yours!\r\nüéØ Preferably for incoming 2nd year students who are ready to take the next step in leadership and service.  \r\nüì© What‚Äôs next?\r\nIf you qualify and are accepted, we‚Äôll send you a confirmation via email, so keep an eye on your inbox!\r\nüóìÔ∏è Deadline of registration: Friday, June 13, 2025\r\nüëâ Register here\r\nhttps://forms.gle/gnwQ77dnYrDEc67A8\r\nhttps://forms.gle/gnwQ77dnYrDEc67A8\r\nhttps://forms.gle/gnwQ77dnYrDEc67A8\r\nBe the reason something great happens this school year.\r\nJoin the movement. Be Squared.', '2025-06-09 13:46:29'),
(17, 'Invite your Friends! ‚ú®üéâ', 'REGISTER NOW to HELIUM SQUARED ‚Äì Version 2.0 of the Squared System! üí°\r\nHello, DCCians! üåü\r\nWe‚Äôre excited to launch Helium Squared, the upgraded and more powerful version of our Squared System ‚Äì designed for students, by students. Whether you\'re looking for academic support, leadership tools, creative services, or just want to be part of something meaningful on campus, this is for YOU!\r\n‚úÖ Faster Services\r\n‚úÖ Smarter Solutions\r\n‚úÖ Better Experience\r\n‚úÖ More Student-Friendly Tools\r\nüîó Register now and be part of the movement that powers campus productivity. Let‚Äôs grow, serve, and achieve more ‚Äî together. üí™‚ú®\r\nüì£ Share this website to your classmates. Share the word. Helium Squared is here!', '2025-06-14 11:56:06'),
(18, 'ùóßùóµùó≤ ùóñùóïùóî ùóñùóºùó∫ùó∫ùòÇùóªùó∂ùòÅùòÜ ùó∂ùòÄ ùóöùó•ùó¢ùó™ùóúùó°ùóö! üß°üíõüî•', 'We\'ve officially blown past expectations and achieved 1,000 Squared Registrations! This is a powerful testament to the value and quality of the CBA Department.\r\n\r\nOther Departments:\r\nCELA - 971\r\nHME- 842\r\nCJE - 668\r\nITE - 217\r\n\r\nThank you to everyone who registered! The future of CBA is looking bright. üåü\r\n#CBADepartment #1000Squared #RegistrationRecord #Success', '2025-10-16 07:20:47');
